import React from 'react';
import ToggleInfo from './ToggleInfo.js';
import List from './List.js';

export class HowItWorks extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
      const userSteps= ['Lorem ipsum dolor sit amet, consectetur adipiscing elit.', 'Cras porta congue neque in molestie. Vestibulum egestas ullamcorper nunc, vel placerat neque blandit non.', 'Sed ut cursus augue.'];
      const hostSteps= ['Lorem ipsum dolor sit amet, consectetur adipiscing elit.', 'Cras porta congue neque in molestie. Vestibulum egestas ullamcorper nunc, vel placerat neque blandit non.', 'Sed ut cursus augue.'];

      const userList = <List bulletPoints={userSteps} ordered={true} />;
      const hostList = <List bulletPoints={hostSteps} ordered={true}/>
    return(

      <div>
      <MDBContainer>
        <MDBRow>
          <MDBCol>
            <ToggleInfo title="Finding a Storage Space" icon="glyphicon glyphicon-plus" content={userList}/>
          </MDBCol>
          <MDBCol>
            <ToggleInfo title="Listing a Storage Space" icon="glyphicon glyphicon-plus" content={hostList}/>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
      </div>


    );
  }
}
export default HowItWorks;
